<title>E-Wallet Transfer</title>
<style>
body { font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif; background: linear-gradient(135deg, #74ebd5 0%, #ACB6E5 100%); margin:0; padding:20px; display:flex; justify-content:center; align-items:flex-start; min-height:100vh; }
.container { background:#fff; padding:30px; border-radius:20px; box-shadow:0 10px 30px rgba(0,0,0,0.15); width:100%; max-width:900px; }
h2 { text-align:center; margin-bottom:10px; color:#333; }
.main-logo { display:flex; justify-content:center; margin-bottom:20px; }
.main-logo img { max-width:120px; border-radius:50%; border:3px solid #007bff; padding:5px; }
.form-sections { display:flex; gap:20px; flex-wrap:wrap; }
.section { flex:1; min-width:280px; background:#f9f9f9; padding:20px; border-radius:12px; }
.section h3 { margin-bottom:15px; color:#007bff; }
label { display:block; margin-bottom:6px; font-weight:600; color:#444; }
input, select { width:100%; padding:12px; margin-bottom:15px; border:1px solid #ccc; border-radius:8px; font-size:14px; }
.transaction { margin-top:20px; padding:20px; background:#f1f7ff; border-radius:12px; }
.transaction p { margin:8px 0; font-size:16px; }
.btn { margin-top:20px; width:100%; padding:16px; font-size:18px; border:none; border-radius:12px; background:#007bff; color:#fff; cursor:pointer; font-weight:bold; transition:0.3s; }
.btn:hover { background:#0056b3; }
@media (max-width:768px){ .form-sections{ flex-direction:column; } }
.wallet-logo { max-width:120px; margin:15px auto; display:block; }
</style>

<h2>E-Wallet Transfer (E-Wallet လွှဲပြောင်းခြင်း။)</h2>

<label for="walletType">Choose E-Wallet (E-Wallet ကို ရွေးပါ။)</label>
<select id="walletType" required>
  <option value="" disabled selected>Select Wallet (Wallet ကို ရွေးပါ။)</option>
  <option value="waveAccount">Wave (Account) (Wave (အကောင့်))</option>
  <option value="wavePassword">Wave (Password) (Wave (စကားဝှက်))</option>
  <option value="kpay">KPay</option>
</select>
<div id="walletLogo"></div>

<div class="form-sections">
  <div class="section">
    <h3>Sender (Malaysia) (ပေးပို့သူ -မလေးရှား))</h3>
    <label for="senderName">Name (နာမည်)</label>
    <input type="text" id="senderName" required>
    <label for="senderPhone">Phone Number (ဖုန်းနံပါတ်)</label>
    <input type="tel" id="senderPhone" placeholder="+60XXXXXXXXX" required>
  </div>
  <div class="section" id="receiverSection">
    <h3>Receiver (Myanmar) (လက်ခံသူ -မြန်မာ)</h3>
    <div id="waveAccountFields" style="display:none;">
      <label for="waveAccNo">Wave Account Number (Wave အကောင့်နံပါတ်)</label>
      <input type="text" id="waveAccNo">
      <label for="waveAccName">Receiver Name (လက်ခံသူအမည်)</label>
      <input type="text" id="waveAccName">
    </div>
    <div id="wavePasswordFields" style="display:none;">
      <p><em>Password Transfer</em></p>
      <label for="wavePwdPhone">Phone Number (ဖုန်းနံပါတ်)</label>
      <input type="tel" id="wavePwdPhone" placeholder="09XXXXXXXXX">
      <label for="wavePwdName">Receiver Name (လက်ခံသူအမည်)</label>
      <input type="text" id="wavePwdName">
    </div>
    <div id="kpayFields" style="display:none;">
      <label for="kpayPhone">KPay Phone Number (KPay ဖုန်းနံပါတ်)</label>
      <input type="tel" id="kpayPhone" placeholder="09XXXXXXXXX">
      <label for="kpayName">Receiver Name (လက်ခံသူအမည်)</label>
      <input type="text" id="kpayName">
    </div>
  </div>
</div>

<div class="transaction">
  <label for="amount">Amount (MYR) (ပမာဏ (MYR))</label>
  <input type="number" id="amount" placeholder="Enter amount">
  <p>Service Charge: <strong>RM <span id="serviceCharge">10</span></strong></p>
  <p>Total Amount: <strong>RM <span id="totalAmount">0</span></strong></p>
  <p>Exchange Rate: <strong>1 MYR = <span id="exchangeRate">520</span> MMK</strong></p>
  <p>You will receive: <strong><span id="receiveMMK">0</span> MMK</strong></p>
</div>

<button class="btn" id="submitBtn">Proceed (ရှေ့ဆက်ပါ။)</button>
</div>

<script>
const serviceCharge=10;
let exchangeRate=localStorage.getItem("exchangeRate")?parseFloat(localStorage.getItem("exchangeRate")):520;
document.getElementById("exchangeRate").innerText=exchangeRate;

document.getElementById("walletType").addEventListener("change",function(){
  document.getElementById("waveAccountFields").style.display="none";
  document.getElementById("wavePasswordFields").style.display="none";
  document.getElementById("kpayFields").style.display="none";
  const logo=document.getElementById("walletLogo");
  if(this.value==="waveAccount"){document.getElementById("waveAccountFields").style.display="block"; logo.innerHTML='<img src="https://cdn6.aptoide.com/imgs/a/d/0/ad05b74cd5f80b55498d98a21368e43e_fgraphic.png" class="wallet-logo">';}
  else if(this.value==="wavePassword"){document.getElementById("wavePasswordFields").style.display="block"; logo.innerHTML='<img src="https://cdn6.aptoide.com/imgs/a/d/0/ad05b74cd5f80b55498d98a21368e43e_fgraphic.png" class="wallet-logo">';}
  else if(this.value==="kpay"){document.getElementById("kpayFields").style.display="block"; logo.innerHTML='<img src="https://www.kbzpay.com/wp-content/uploads/sites/9/2020/04/og_image_for_kbzpay.png" class="wallet-logo">';}
  else{logo.innerHTML="";}
});

document.getElementById("amount").addEventListener("input",function(){
  const amount=parseFloat(this.value)||0;
  document.getElementById("totalAmount").innerText=(amount+serviceCharge).toFixed(2);
  document.getElementById("receiveMMK").innerText=(amount*exchangeRate).toFixed(0);
});

function validateForm(walletType){
  if(!document.getElementById("senderName").value||!document.getElementById("senderPhone").value||!document.getElementById("amount").value) return false;
  if(walletType==="waveAccount") return document.getElementById("waveAccNo").value && document.getElementById("waveAccName").value;
  if(walletType==="wavePassword") return document.getElementById("wavePwdPhone").value && document.getElementById("wavePwdName").value;
  if(walletType==="kpay") return document.getElementById("kpayPhone").value && document.getElementById("kpayName").value;
  return false;
}

document.getElementById("submitBtn").addEventListener("click",function(){
  const walletType=document.getElementById("walletType").value;
  if(!walletType){alert("Please select wallet type!"); return;}
  if(!validateForm(walletType)){alert("⚠️ Please fill in all required fields."); return;}

  let transaction={
    receiptCode:"RC"+Date.now(),
    senderName:document.getElementById("senderName").value,
    senderPhone:document.getElementById("senderPhone").value,
    walletType,
    amount:document.getElementById("amount").value,
    total:(parseFloat(document.getElementById("amount").value)+serviceCharge).toFixed(2),
    mmkAmount:(parseFloat(document.getElementById("amount").value)*exchangeRate).toFixed(0)
  };

  if(walletType==="waveAccount"){transaction.accountNumber=document.getElementById("waveAccNo").value; transaction.receiverName=document.getElementById("waveAccName").value;}
  else if(walletType==="wavePassword"){transaction.receiverPhone=document.getElementById("wavePwdPhone").value; transaction.receiverName=document.getElementById("wavePwdName").value;}
  else if(walletType==="kpay"){transaction.receiverName=document.getElementById("kpayName").value; transaction.receiverPhone=document.getElementById("kpayPhone").value;}

  let transactions=JSON.parse(localStorage.getItem("transactions")||"[]");
  transactions.push(transaction);
  localStorage.setItem("transactions",JSON.stringify(transactions));

  alert("✅ Transaction saved! Redirecting to receipt...");
  window.location.href=`receipt.html?receipt=${transaction.receiptCode}`;
});
</script>
</body>
</html>
